import React from 'react';
import { categories } from './data/categories';

const CoolPage: React.FC = () => {
  // You can define what makes a category "cool"
  const coolCategories = categories.filter(category => category.count > 1000);

  return (
	<div>
	  <h2>What's Cool?</h2>
	  <ul>
		{coolCategories.map((category, index) => (
		  <li key={index}>
			{category.name} <span className="count">({category.count})</span>
		  </li>
		))}
	  </ul>
	</div>
  );
};

export default CoolPage;
